import React from "react";
import "./Subtotal.css";
import CurrencyFormat from "react-currency-format";


function Subtotal() {
  return (
    <div className="subtotal">
      {/* Price */}

      <CurrencyFormat
        decimalScale={2}
        value={0} // part of the Homework
        displayType={"text"}
        thousandSeparator={true}
        prefix={"$"}
      />
      <button>Proceed to Checkout</button>
    </div>
  );
}

export default Subtotal;
